import React, { Component } from 'react';
import './App.css';
import NavBar from './components/navbar.jsx'
import Search from './components/searchField.jsx'
import DropDown from './components/dropdownFilter.jsx'
import IssueElement from './components/divIssue.jsx'


import { Tabs, Tab } from 'react-bootstrap'
import './styles/git_stylesheet.css'
import './styles/git_stylesheet2.css'


import Issue from './issue';

class App extends Component {


  render() {


    let issues = [];
    issues.push(new Issue("23432", "Sheltine", "2 days", "odsnconsc", "2"));
    issues.push(new Issue("2342", "Nyahon", "3 days", "aefea", "2"));
    issues.push(new Issue("545645", "coucou", "1 week", "wefw", "2"));
    issues.push(new Issue("232345", "lolol", "2 minutes", "ergethtehg", "4"));
    issues.push(new Issue("6666666", "Satan", "2000 years", "agegaergfaerg", "1"));



    return (

      <div className="App">
        <header>

        </header>
        <NavBar/>

        <Tabs defaultActiveKey={2} id="uncontrolled-tab-example">
        <Tab eventKey={1} title="Code"/>
        <Tab eventKey={2} title="Issues">
        <div class="repository-content ">
            <DropDown/><Search/>

                        {
                          issues.map((issue) => (
                            <IssueElement id={issue.id} user={issue.user} title={issue.title} time={issue.time} comments={issue.comments}/>
                          ))
                        }

        </div>

        </Tab>
        <Tab eventKey={3} title="Pull Requests"/>
        <Tab eventKey={3} title="Projects"/>
        <Tab eventKey={3} title="Insights"/>

      </Tabs>

      </div>
    );
  }
}



export default App;
